import React from 'react';
import Nav from './Nav';
import './style/review.css';

const ReviewPage = () => {
  return (
    <div className="review-container">
      <Nav />
      <div className="review-data">
        <div className="review-image">
          <img src="../images/maukuSencis.jpg" alt="Review Image" />
        </div>
      </div>
    </div>
  );
}

export default ReviewPage;
